import { createUseStyles } from "react-jss";
import clsx from "clsx";

const useStyles = createUseStyles({
    addTasks__bar:{
        display: "flex",
        top: "150%",
        right: "0",
        width: "30rem",
        padding: "0 1.3rem",
        borderRadius: "1.3rem",
        border: "3px solid var(--background-color-header)",

    }
});

export default function AddTask() {
  const classes = useStyles();

  return (
    <div
      className="addTasks__bar position-absolute align-items-center "
      style={{
      }}
    >
      <div
        className="addTasks__button d-flex"
        style={{
          padding: "0.3rem",
          borderRadius: "0.7rem",
        }}
      >
        <ion-icon
          name="add"
          style={{
            fontSize: "1.7rem",
            cursor: "pointer",
          }}
        ></ion-icon>
      </div>
      <div className="addTasks__input w-100">
        <input
          type="text"
          placeholder="Add task"
          className="w-100 input--none-border"
          style={{
            fontSize: "1.6rem",
          }}
        />
      </div>
      <div className="addTasks__button">
        <ion-icon
          name="close"
          style={{
            fontSize: "2rem",
            cursor: "pointer",
          }}
        ></ion-icon>
      </div>
    </div>
  );
}
